import React from 'react';

class EmployeeLeft extends React.Component {
    render() {
        let { employees, count, onClickEmployee, onClickPageNo, queryParams } = this.props;
        let employeeList = null;


        let pageLink = [];
        let pageSize = 5;
        let pageNo = 1;
        if(!!queryParams) {
            pageNo = queryParams["PageNo"]
            pageSize = queryParams["PageSize"]
        }
        console.log(queryParams);
        let totalPageNo = Math.ceil(count / PageSize);

        if (!!employees) {
            console.log("count:" + count);
            employeeList = employees.map((employee) => (
                <p key={employee.EmployeeID}>
                    <a href='' onClick={() => onClickEmployee(employee.EmployeeID)}>
                        {employee.EmployeeNumber} {employee.FirstName} {employee.LastName}</a>
                </p>
            ));
            for (let i = 0; i < totalPageNo; i++) {
                pageLink.push(
                    <a href={'./employees?pageSize='+pageSize+'&pageNo='+pageNo} onClick={() => onClickPageNo(pageSize, i)} > {i + 1} </a>
                );
            }
        }
        return (
            <div>
                {employeeList}
                <div id='pg'>{pageLink}</div>
                
            </div>
        );
    }
}

export { EmployeeLeft }
